function sumPrimes(num) {
  let answer = []; 
  while (num>1) {
    let prime = true;
    for (let i=2; i<(num-1);i++) {
      if (num%i==0) {
        prime = false;
        break;
      };
    };
    if (prime) answer.push(num);
    num--;
  };
  console.log(answer);
  return answer.reduce((a,b)=>a+b);
}

